        /// <summary>
        /// Reads an string definition of a card and returns the Card value.
        /// </summary>
        /// <param name="card">card string</param>
        /// <returns></returns>
        public static int ParseCard(string card)
        {
#if DEBUG
            if (card == null)
                throw new ArgumentNullException("card");
#endif
            int index = 0;
            return NextCard(card, ref index);
        }

        /// <summary>
        /// Parses Card strings (internal)
        /// </summary>
        /// <param name="cards">string containing hand definition</param>
        /// <param name="index">iterator into card string</param>
        /// <returns></returns>
        public static int NextCard(string cards, ref int index)
        {
            int rank = 0, suit = 0;
#if DEBUG
            if (cards == null) throw new ArgumentNullException("cards");
#endif

            // Remove whitespace
            while (index < cards.Length && cards[index] == ' ')
                index++;

            if (index >= cards.Length)
                return -1;

            // Parse cards
            if (index < cards.Length)
            {
                switch (cards[index++])
                {
                    case '1':
                        try
                        {
                            if (cards[index] == '0')
                            {
                                index++;
                                rank = RankTen;
                            }
                            else
                            {
                                return -1;
                            }
                        }
                        catch
                        {
                            throw new ArgumentException("Bad hand string");
                        }
                        break;
                    case '2':
                        rank = Rank2;
                        break;
                    case '3':
                        rank = Rank3;
                        break;
                    case '4':
                        rank = Rank4;
                        break;
                    case '5':
                        rank = Rank5;
                        break;
                    case '6':
                        rank = Rank6;
                        break;
                    case '7':
                        rank = Rank7;
                        break;
                    case '8':
                        rank = Rank8;
                        break;
                    case '9':
                        rank = Rank9;
                        break;
                    case 'T':
                    case 't':
                        rank = RankTen;
                        break;
                    case 'J':
                    case 'j':
                        rank = RankJack;
                        break;
                    case 'Q':
                    case 'q':
                        rank = RankQueen;
                        break;
                    case 'K':
                    case 'k':
                        rank = RankKing;
                        break;
                    case 'A':
                    case 'a':
                        rank = RankAce;
                        break;
                    default:
                        return -2;
                }
            }
            else
            {
                return -2;
            }

            if (index < cards.Length)
            {
                switch (cards[index++])
                {
                    case 'H':
                    case 'h':
                        suit = Hearts;
                        break;
                    case 'D':
                    case 'd':
                        suit = Diamonds;
                        break;
                    case 'C':
                    case 'c':
                        suit = Clubs;
                        break;
                    case 'S':
                    case 's':
                        suit = Spades;
                        break;
                    default:
                        return -2;
                }
            }
            else
            {
                return -2;
            }

            return rank + (suit * 13);
        }

        /// <summary>
        /// Given a card value, returns it's rank
        /// </summary>
        /// <param name="card">card value</param>
        /// <returns>returns rank</returns>
        public static int CardRank(int card)
        {
#if DEBUG
            // Legal values are 0 - 52.
            if (card < 0 || card > 52)
                throw new ArgumentOutOfRangeException("card");
#endif
            return card % 13;
        }

        /// <summary>
        /// Given a card value, returns it's suit
        /// </summary>
        /// <param name="card">Card value</param>
        /// <returns>suit</returns>
        public static int CardSuit(int card)
        {
#if DEBUG
            // Legal values are 0 - 52.
            if (card < 0 || card > 52)
                throw new ArgumentOutOfRangeException("card");
#endif
            return card / 13;
        }

