        /// determine which has the higher value.
        /// </summary>
        /// <param name="cards">hand mask</param>
        /// <returns>Hand Value bit field</returns>
        public static uint Evaluate(ulong cards)
        {
            return Evaluate(cards, BitCount(cards));
        }

