        /// <param name="obj">object to compare against</param>
        /// <returns></returns>
        public int CompareTo(object obj)
        {
            Hand h = obj as Hand;
            if (h == null) return -1;
            return ((int)HandValue) - ((int)h.HandValue);
        }

